import './App.css';
import { Button } from 'react-bootstrap';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
  import { faCoffee } from '@fortawesome/free-solid-svg-icons'

function App() {
  return (
    <div className="App">
      <h1>Hello!</h1>
      <button>Heeey</button>
      <Button><FontAwesomeIcon icon={faCoffee} /></Button>
    </div>
  );
}

export default App;
